    "2016-07-27T23:01:42.221383",nt"name": "bird-populations-and-habitat-use-in-the-okpilak-river-delta-area-arctic-national-wildlife-",nt"isopen":
    false,nt"url": null,nt"notes": "Bird census plots totaling 1.75 square-km
    in area on the Okpilak River delta, Arctic National Wildlife Range, Alaska, were
    sampled to determine nesting bird density and total breeding and non-breeding population
    during the summer of 1978. A total of 57 bird species were observed on the study
    area, while 23 species were recorded as breeding. The most abundant species were
    (in descending order): Lapland Longspur, Pectoral Sandpiper, Red Phalarope, Northern
    Phalarope, and Semipalmated Sandpiper.",nt"license_title": "License Not Specified",nt"extras":
